func getSeverityBadgeClass(vulnCount int) string {
	if vulnCount >= 5 {
		return "badge-critical"
	} else if vulnCount >= 3 {
		return "badge-high"
	} else if vulnCount >= 1 {
		return "badge-medium"
	}
	return "badge-low"
}

func getSeverityBadgeClassFromString(severity string) string {
	switch severity {
	case "CRITICAL":
		return "badge-critical"
	case "HIGH":
		return "badge-high"
	case "MEDIUM":
		return "badge-medium"
	case "LOW":
		return "badge-low"
	default:
		return "badge-info"
	}
}

